import React from 'react';
import ReactDOM from 'react-dom';
var jazzicon = require('jazzicon')


export default function Jazzicon(props) {

    var el = jazzicon(100, props.address)

    return (
        <div class="row center-align">
            {el.svg}
        </div>
    );
}
